import "./App.css";
import Navbar from "./components/Navbar";
import Table from "./components/Table";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";
import EditContact from "./pages/EditContact";

function App() {
  const [contacts, setContacts] = useState([
    {
      id: 0,
      firstName: "Albert",
      lastName: "Qi",
      email: "albertqiisthebest@college.harvard.edu",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn 999",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
    {
      id: 1,
      firstName: "Prat",
      lastName: "Mallick",
      email: "pratyushmallick@college.harvard.edu",
      phoneNumber: "111-111-1111",
      houseYard: "Maple Yard",
      suite: "Inn #",
      classYear: "First-Year",
      homeCity: "Needham",
      homeState: "MA",
      contactStatus: "Contacted",
      pteStatus: "PTE",
      registrationStatus: "Registered",
      stageOfVotingProcess: "Done",
      whereRegistered: "MA",
    },
  ]);

  const header = [
    "First Name",
    "Last Name",
    "Email",
    "Phone Number",
    "House/Yard",
    "Suite",
    "Class Year",
    "Home City",
    "Home State",
    "Contact Status",
    "PTE Status",
    "Registration Status",
    "Stage of Voting Process",
    "Where Registered",
    "Actions",
  ];

  // Edit Contact
  const editContact = (id) => {
    console.log("edit", id);
  };

  // Delete Contact
  const deleteContact = (id) => {
    setContacts(contacts.filter((contact) => contact.id !== id));
  };

  return (
    <>
      <Router>
        {/* <Navbar /> */}
        {/* <Routes> */}
          {/* <Route path="/sign-up" component={SignUp} /> */}
          <Route
            path="/"
            exact
            render={(props) => (
              <>
                {contacts.length > 0 ? (
                  <Table
                    tableHeader={header}
                    contacts={contacts}
                    onEdit={editContact}
                    onDelete={deleteContact}
                  />
                ) : (
                  "No contacts"
                )}
              </>
            )}
          />
          <Route path="/edit-contact" component={EditContact} />
        {/* </Routes> */}
      </Router>
    </>
  );
}

export default App;
